//SPDX-License-Identifier: LGPL-3.0-only

//Version
pragma solidity ^0.8.24;

    
//contract
contract ContractB{
    address public contractA;
    address public origin;

    constructor(address contractA_){
        contractA = contractA_;
    }

    event Recibido(address indexed from, uint256 amount);

    receive() external payable {
        emit Recibido(msg.sender, msg.value);
    }

    function receiveEth(address from_, uint amount_) public payable returns (bool) {
        //this contract can only receive at least 10,000 gas
        require(msg.value >= amount_+10000);
        emit Recibido(from_, amount_);

        contractA = msg.sender;
        origin = tx.origin;
        return true;
    }
}

